import Item from "./Item";
import React from "react";
import { Col, Row } from "react-bootstrap";
import "../Css/ItemList.css"

const ItemList = (data) => {
    console.log("Estos son los productos", data.productos)
    const laRopa = data.productos



    const loRetornable = laRopa.map((prenda) => {
        return (
            <Col md="3" mb="2">
                <p> {prenda.nombre}</p>
                <img
                    className="remera"
                    src={prenda.imagen}
                />
                <p> {prenda.precio}</p>
            </Col>
        )
    })

    return (
        <Row className="justify-content-md-center">
            <Col md="3" mb="2">
                {laRopa.map((prenda) => (
                    <div>
                        <p> {prenda.nombre}</p>
                        <img
                            className="remera"
                            src={prenda.imagen}
                        />
                        <p> {prenda.precio}</p>
                    </div>
                )
                )}
            </Col>
        </Row>
    )

}
export default ItemList;
